import React from 'react';

import Hero from '../components/resumable/Hero';
import Banner from '../components/resumable/Banner';

const Home = () => {
  return (
    <Hero hero='defaultHero'>
      <Banner
        title='럭셔리 룸'
        subtitle='최저가 룸이 299달러 부터 시작합니다'
      ></Banner>
    </Hero>
  );
};

export default Home;
